/*Table structure for table `tbl_product_enquiry` */

DROP TABLE IF EXISTS `tbl_product_enquiry`;

CREATE TABLE `tbl_product_enquiry` (
  `user_id` bigint(20) NOT NULL COMMENT 'user identity number',
  `user_name` varchar(255) DEFAULT NULL COMMENT 'user name ',
  `user_mobile` bigint(20) DEFAULT NULL COMMENT 'user mobile number',
  `user_email` varchar(300) DEFAULT NULL COMMENT 'user email address',
  `product_id` bigint(20) unsigned NOT NULL COMMENT 'product identity number',
  `vendor_id` bigint(20) unsigned NOT NULL COMMENT 'vendor identity number',
  `user_ip_address` varchar(250) DEFAULT NULL COMMENT 'user ip address',
  `type_flag` tinyint(2) unsigned NOT NULL COMMENT '{0-Enquiry| 1-Viewed}',
  `updatedby` varchar(50) NOT NULL DEFAULT 'CUSTOMER' COMMENT 'value inserted in database by',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'timestamp on which it was last updated',
  `date_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'date and time on which it was created',
  KEY `product_id` (`product_id`),
  KEY `vendor_id` (`vendor_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

