/*Table structure for table `tbl_wishlist` */

DROP TABLE IF EXISTS `tbl_wishlist`;

CREATE TABLE `tbl_wishlist` (
  `wid` int(20) NOT NULL AUTO_INCREMENT,
  `uid` bigint(15) unsigned NOT NULL COMMENT 'user id ',
  `pid` bigint(20) unsigned NOT NULL COMMENT 'product id',
  `vid` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT 'vendor id',
  `wf` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1-Active,0-Inactive',
  `date_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'date and time on which it was created',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'timestamp on which it was last updated',
  PRIMARY KEY (`uid`,`pid`,`vid`),
  KEY `wid` (`wid`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=latin1;

